import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import './App.css';
import { Home, Ourstory, Ourteam, Purpose, Roadmap } from './pages';
import json from './components/hero2/hero2.json';


function App() {
  return (
    <Router>
      <div className='app__container'>
        <div className='app__box'>
          <Routes>
            <Route path="/" exact element={<Home/>}/>
            {json.purpose.map( purpose => (
              <>
                <Route path={purpose.path} exact element={<Purpose title={purpose.title}/>}/>
                <Route path={purpose.path} exact element={<Purpose title={purpose.title}/>}/>
              </>
            ))}
            <Route path="/ourteam" exact element={<Ourteam/>}/>
            <Route path="/roadmap" exact element={<Roadmap/>}/>
          </Routes>
        </div>
      </div>
    </Router>
  );
}

export default App;
